import '../style1.css';
import '../style.css';
import React , {Component} from 'react';

class Table extends Component  {

 //الكتابه 
render() { 
const {datajson , delet} = this.props
    return(
        <div>
            <table id="table" >
            <tbody>    
                <tr>
            <td  >المدن</td>
            <td >عدد السكان</td>
                </tr>
        {datajson.map(function data(d) {
        
        
            return(
        
                <tr key={d.id} >
                    <td >{d.citie}</td>
                    <td >{d.peples}</td>
                    <td>
                    <button > تعديل </button> 
                    <button  id = "delet" onClick={data.filter(a=> a.id !== d.id)}> حدف  </button> 
                    </td>
                </tr>
                    )   
                })}
            </tbody>
            </table>
        
    
        </div>
        )

}
}
export default Table;
